const FooterImage = () => {
    let images = [
        {
            text: 'ESSIENTIAL OILS',
            image: require('../../assets/hypoallergenic.png'),
        },
        {
            text: '100% VEGAN',
            image: require('../../assets/natural.png'),
        },
        {
            text: 'SKIN FRIENDLY',
            image: require('../../assets/green.png'),
        },
        {
            text: 'GLUTEN FREE',
            image: require('../../assets/gluten.png'),
        },
        {
            text: 'NON TOXIC',
            image: require('../../assets/toxic.png'),
        },
        {
            text: 'CRUELTY FREE',
            image: require('../../assets/cruelty.png'),
        },
        {
            text: 'NO HARSH CHEMICALS',
            image: require('../../assets/paraben.png'),
        },
        {
            text: 'GMP CERTIFIED',
            image: require('../../assets/industry.png'),
        },
        {
            text: 'PROPERLY TESTED',
            image: require('../../assets/solidarity.png'),
        },
        {
            text: 'MADE WITH LOVE',
            image: require('../../assets/Group117.png'),
        },
    ];

    return images;
}
export default FooterImage;
